/**
 * artist
 * album
 * genre
 * release_date
 * label
 * price
 * tracklist
 * cover_image
 */
const InventoryList = ({products}) => {

  return (
    <div className="container">
      <div className="row">
        <div className="col">
          
          {products.map(p => (
            <div>
              Album Cover:
              <img
                src={p.cover_image} alt="album artwork/covers"
                style={{
                  height: 70,
                  width: 70,
                  margin: 15
                }}/>
              <span class="row">{p.artist}</span>
            </div>
          )) }
          </div>          
      </div>    
    </div>    
      
  );
}; export default InventoryList;
